import React from 'react'
import axios from 'axios'
import { useState, useEffect } from 'react'

const ForecastCardBackground = () => {
    const [tide, setTide] = useState([])

    useEffect(() => {

        const lat = 60.936;
        const lng = 5.114;

        axios
          .get(
            `https://api.stormglass.io/v2/tide/extremes/point?lat=${lat}&lng=${lng}&start=2023-04-18&end=2023-04-29`,{
            headers: {
                'Authorization': 'example-api-key'
              }}
          )
          .then((res) => res.data)
          .then((data) => {
            setTide(data);
          }); 
      }, []);

      console.log(tide)
    
  return (
    <div>Ici ira la Forecast Card</div>
  )
}

